import React from 'react';
import NavBar from '../../components/NavBar/NavBar';
import Footer from '../../components/Footer/Footer';
import './SearchResultPage.css';

const SearchResultPage = () => {
  return (
    <div>
      <NavBar />
      <div>
        <h1>Search</h1>
        <div>
        <p>Destination</p>
        <input type="text" />  
        </div>
        <div>
          <p>Check-in date</p>
          <input type="text" />
        </div>

      </div>
      <Footer />
    </div>
  );
}

export default SearchResultPage;
